IF NOT EXISTS (
    select * from sysobjects where name='movies_data' and xtype='U'
) CREATE TABLE [movies_data] (
    [Movie] NVARCHAR(83),
    [Director] NVARCHAR(32),
    [Running_time] INT,
    [Actor_1] NVARCHAR(27),
    [Actor_2] NVARCHAR(28),
    [Actor_3] NVARCHAR(29),
    [Genre] NVARCHAR(11),
    [Budget] INT,
    [Box_Office] BIGINT,
    [Actors_Box_Office] NUMERIC(15, 2),
    [Director_Box_Office] NUMERIC(5, 2),
    [Earnings] BIGINT,
    [Oscar_and_Golden_Globes_nominations] INT,
    [Oscar_and_Golden_Globes_awards] INT,
    [Release_year] INT,
    [IMDb_score] NUMERIC(2, 1)
);
